import Utils from "./Utils";
import {isKanjiResult, SearchResults} from "./interfaces/SearchResults";

export default class AudioPlayer {
  static getAudioUrl(entry: SearchResults & { selected?: number }): string {
    let kanaText;
    let kanjiText;
    const selected = entry.selected || 0;

    //We have a single kanji selected
    if (isKanjiResult(entry)) {
      entry.onkun.match(/^([^\u3001]*)/);

      kanjiText = entry.kanji;
      kanaText = RegExp.$1;

      if (!kanjiText || !kanaText) return;

      kanaText = Utils.convertKatakanaToHirigana(kanaText).kana;

      if (!kanaText) return;
    } else if (entry.data[selected]) {
      let entryData = entry.data[selected][0].match(
        /^(.+?)\s+(?:\[(.*?)\])?\s*\/(.+)\//
      );

      if (!entryData) return "";

      // Get just the kanji and kana
      kanjiText = entryData[1];
      kanaText = entryData[2];

      if (!kanjiText) return "";

      if (!kanaText) kanaText = kanjiText;
    } else {
      return "";
    }

    let [fixedKana, fixedKanji] = this.fixKanaKanjiForLanguagePod(
      kanaText,
      kanjiText
    );

    const url = `http://assets.languagepod101.com/dictionary/japanese/audiomp3.php?kana=${fixedKana}&kanji=${fixedKanji}`;

    console.log(url);
    return url;
  }

  /**
     * Check:
     *
     * インドシナ;印度支那(ateji),インドシナ;印度支那
     おわいや;汚穢屋(oK),おわいや;汚穢屋
     カタル;加答児(ateji),カタル;加答児
     とそつてん;兜率天(oK),とそつてん;兜率天
     カンブリア;寒武利亜(ateji),カンブリア;寒武利亜
     たへる(ok);堪へる,たへる;堪へる
     もとずく(ik);基ずく,もとずく;基ずく
     きゅうらい;救癩(oK),きゅうらい;救癩
     * @param kana
     * @param kanji
     */

  static fixKanaKanjiForLanguagePod = (
    kana: string,
    kanji: string
  ): [string, string] => {
    const map = {
      "ありがと;ありがと": "ありがと(ik);ありがと(ik)",
      "あんまし;按摩師": "あんまし;按摩師(oK)",
      "あんまさん;按摩さん": "あんまさん;按摩さん(oK)",
      "インドシナ;印度支那": "インドシナ;印度支那(ateji)",
      "おわいや;汚穢屋": "おわいや;汚穢屋(oK)",
      "カタル;加答児": "カタル;加答児(ateji)",
      "とそつてん;兜率天": "とそつてん;兜率天(oK)",
      "カンブリア;寒武利亜": "カンブリア;寒武利亜(ateji)",
      "たへる;堪へる": "たへる(ok);堪へる",
      "もとずく;基ずく": "もとずく(ik);基ずく",
      "きゅうらい;救癩": "きゅうらい;救癩(oK)",
    };

    if (!map[`${kana};${kanji}`]) return [kana, kanji];
    return map[`${kana};${kanji}`].split(";");
  };

  static async getAudioBase64(
    entry: SearchResults,
    shortenNoAudio: boolean = true
  ): Promise<string> {
    const longNoAudio =
      "";

    function arrayBufferToBase64(buffer) {
      let binary = "";
      const bytes = [].slice.call(new Uint8Array(buffer));

      bytes.forEach((b) => (binary += String.fromCharCode(b)));

      return btoa(binary);
    }

    return fetch(AudioPlayer.getAudioUrl(entry))
      .then((response) => response.arrayBuffer())
      .then((result) => arrayBufferToBase64(result))
      .then((content) => {
        if (content === longNoAudio && shortenNoAudio === true) {
          return fetch("resources/no_audio.mp3")
            .then((response) => response.arrayBuffer())
            .then((response) => arrayBufferToBase64(response));
        }

        return content;
      });
  }

  static async isNoAudio(entry): Promise<boolean> {
    const longNoAudio =
      "";
    const audio = await this.getAudioBase64(entry, false);

    return audio === longNoAudio;
  }

  static async play(entry, config) {
    this.getAudioBase64(entry).then((content) => {
      const audio = new Audio("data:audio/wav;base64," + content);
      audio.volume = config.audioVolume / 100 || 1;
      audio.play();
    });
  }
}
